Lab 02: Python Fundamental Part 02 <ul> <li><p>This lab covers the fundamentals of Python data, including topics such as loop, while and functions.</p> </li> <li><p>There are three questions in total. Please provide your code answers directly below each question.</p> </li> <li><p>Make sure to run all cells so that the answers are stored. Once completed, export your .ipynb file as either HTML or PDF, ensuring that all answers are included. Submit the HTML or PDF file to Canvas by midnight (11:29 PM) on September 15.</p> </li> <li><p>This lab is worth a total of 65 points and contributes 6.5% toward the final grade.</p> </li> </ul> <ol> <li>Write a function to provide student's grade in letter</li> </ol> <p>If student's score range from 100 - 80 then return A, range from 79-60 then return B, below 60 then return C</p> <p>The function should:</p> <ul> <li>Take one arguments: score in number</li> <li>Return the score in letter (A,B, or C)</li> </ul> In [1]: Copied! <pre>def get_letter(score):
    if score &lt; 100 and score &gt; 80:
        return "A"
    elif score &gt; 60 and score &lt; 80:
        return "B"
    else:
        return "C"

print(get_letter(90))
print(get_letter(75))
print(get_letter(50))
</pre> def get_letter(score):     if score &lt; 100 and score &gt; 80:         return "A"     elif score &gt; 60 and score &lt; 80:         return "B"     else:         return "C"  print(get_letter(90)) print(get_letter(75)) print(get_letter(50)) Out[1]: <pre>'A'</pre> <ol> <li>Write a function to return the latitude and longitude coordinates for one of the 3 parks in Worcester:</li> </ol> <ul> <li>Take one arguments: park name</li> <li>Return the latitude and longitude of the park</li> <li>If input argument is not in the dictionary, return 'Park not found'</li> </ul> <p>You output should like below:</p> <p></p> In [3]: Copied! <pre># Use below dictionary to finish Q2
